import React from "react";

const List = (props) => {
    const { contents } = props;
    if (!contents || contents.length === 0) return <h1>No hay Peliculas</h1>

    return (
        <ul>
            <h2>Peliculas </h2>
            {contents.map((content) => {
                return (
                    <div style={{ background: "orange", margin: "10px" }}>
                        <li key={content.id}>
                            <span><b>Pelicula: </b>{content.name}</span>
                            <span><b>AÃ±o de lanzamiento: </b>{content.year}</span>
                            <span><b>Director: </b>{content.director_name}</span>
                        </li>
                    </div>

                )
            })}
        </ul>
    );

}
export default List;
